    false,nt"url": null,nt"notes": "This report covers the construction of
    an 8mm camera for biological research. A time-lapse camera for use in biological
    research can be constructed from a super 8-mm movie camera. A single-frame release
    is activated through a solenoid controlled by an electronic timer. The unit is activated
    by a photo cell for daylight operation. Timing interval can be varied from 1/2 second
    to 60 minutes. With a 5-minute interval and 12 hours of daylight, one roll of film
    will last 25 days. The unit operates from a 6-volt d.c. power supply.",nt"license_title":
